import { defineStore } from "pinia";

/*
Classes
*/
class Food {
  id;
  name;
  icon;
  description;
  protein;
  fat;
  carbs;
  mult;
}

class PlanInfo {
  created;
  protein;
  fat;
  carbs;
  days;
  calculationMethod;
  calculationError;
}

/*
Store
*/
export const mainStore = defineStore("mainStore", {
  state: () => {
    return {
      allFoodItems: [],
      planFoodItems: [],
      planInfo: null,
      day: 0,
    };
  },
});

/*
Init
*/
const store = mainStore();
store.planInfo = {
  created: 0,
  protein: 0,
  fat: 0,
  carbs: 0,
  days: 0,
  calculationMethod: null,
  calculationError: null,
};

store.planInfo = new PlanInfo();
store.planInfo.created = 0;
